object.fastTimerScript:
let online = 0;
let offline = 0;
for (let index = 1; index <= 12; index++) {
    var objName = 'F00' + index;
    if (index >= 10)
        objName = 'F0' + index;
    if (asset[objName]) {
        var status = asset[objName].状态;
        if (status == '离线')
            offline++;
        else
            online++;
    }
}
assetMag.setRootAttrValue('online', online + '');
assetMag.setRootAttrValue('offline', offline + '');

object.styleScript:
var objName = assetMag.getParentAttrValue(cell,'objName');    
assetMag.init(objName, ['状态']);
    var status = asset[objName].状态;
    var fillColor = '';
    if (status == '故障')
        fillColor = '#FF1414';
    else if (status == '离线')
        fillColor = '#808080'
    else
        fillColor = '#336600'
    return { 'fillColor': fillColor };

var objName = assetMag.getParentAttrValue(cell,'objName');
assetMag.init(objName,['保养时间']);
    return {'label':asset[objName].保养时间};

var objName = assetMag.getParentAttrValue(cell,'objName');   
 assetMag.init(objName, ['设备利用率']);
    let value = asset[objName].设备利用率;
    value = value * 100+'%';
    return { 'label': value };

object.slowTimerScript:
var objName = assetMag.getParentAttrValue(cell,'objName');
assetMag.init(objName, ['状态']);
    let status = asset[objName].状态;
    let value = '0';
    let newValue = '0';
    if (status == '运行') {
        let state = graph.getView().getState(cell);
        if (state != null) {
            value = state.style[mxConstants.STYLE_ROTATION] || value;
        }
        newValue = Number(value) + 10;
        if (newValue > 360)
            newValue = newValue - 360;
        newValue += '';
    }
    graph.setCellStyles(mxConstants.STYLE_ROTATION, newValue, [cell]);

